dy assigned to the vendor list\";s:13:\"pays_vat_rate\";s:24:\"VAT rate in % (optional)\";s:11:\"pays_vendor\";s:6:\"Vendor\";s:7:\"price_a\";s:5:\"Price\";s:6:\"prices\";s:6:\"Prices\";s:6:\"update\";s:6:\"Update\";}'),('pwassist','en','a:15:{s:19:\"password_assistance\";s:19:\"Password Assistance\";s:20:\"pwassist_enter_email\";s:345:\"Please enter an email address and submit the form.\\nILIAS will send an email to that address. The email contains all usernames which have registered this email address.\\nChoose a suitable username and use the password service to retrieve a new password. If you do not retrieve any email by this service please contact your course admin or %1$s. \";s:33:\"pwassist_enter_username_and_email\";s:374:\"Enter a user name and the associated email address in the fields shown below.\\nILIAS will send a message to that email address. The message contains an address for a web page, where you can enter a new password for the user account.\\nIn case your unable to assign a password to your user account using this form, contact your course administration or send an email to %1$s. \";s:40:\"pwassist_enter_username_and_new_password\";s:61:\"Enter the user name and the new password in the fields below.\";s:22:\"pwassist_invalid_email\";s:96:\"Please correct your email address.\\nThe given email address could not be found in the database. \";s:34:\"pwassist_invalid_username_or_email\";s:134:\"Please correct the text in the entry fields.\\nThe user name and email address you have entered do not match an entry in the database. \";s:24:\"pwassist_login_not_match\";s:142:\"Please enter another user name.\\nThe user name you have entered does not match the user name for which you had asked for password assistance. \";s:18:\"pwassist_mail_body\";s:1175:\"Register a new password for your user account:\\n\\t%1$s\\n\\nThis message has been generated automatically by the ILIAS server\\n\\t%2$s\\n\\nYou (or someone at %3$s) has asked for password assistance for the user account \"%4$s\".\\n\\nPlease check carefully the conditions listed below, and proceed accordingly:\\n\\n- If you have used the password assistance form on the ILIAS server by accident:\\nDelete this mail.\\n\\n- If you are certain, that you never asked for password assistance at this ILIAS server:\\nPlease contact %5$s.\\n\\n- If you asked for password assistance, please proceed as follows:\\n\\n1. Open your browser.\\n\\n2. Enter the following address in your browser:\\n\\t%1$s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your email program has inserted these line breaks.\\n\\n3. On the web page shown by your browser, enter a new password for your user account.\\n\\nPlease note, that for security reasons, you can perform you can perform the three steps abeove only exactly once and for a limited time only. Afterwards the address becomes invalid, and you have to use the password assistance page on the ILIAS server again. \";s:18:\"pwassist_mail_sent\";s:62:\"A message has been sent to %1$s.\\nPlease check your mail box. \";s:21:\"pwassist_mail_subject\";s:25:\"ILIAS Password Assistance\";s:22:\"pwassist_not_permitted\";s:106:\"Please enter another user name.\\nPassword assistance is not permitted for the user name you have entered. \";s:26:\"pwassist_password_assigned\";s:60:\"The password has been successfully assigned to user \"%1$s\". \";s:24:\"pwassist_session_expired\";s:255:\"Please fill in this form again.\\nYour password assistance session has expired. This may have happened, because you tried to use the link that has been emailed to you more than once, or because too much time has passed since the link has been sent to you. \";s:21:\"pwassist_update_error\";s:142:\"Please contact your system administrator.\\nThe password could not be assigned to the user account due to an error whe updating the data base. \";s:27:\"pwassist_username_mail_body\";s:900:\"These are the active username found for the given email address:\\n%s\\n\\nThis message has been created automatically by the following ILIAS Server:\\n\\t%s\\n\\nYou (or somebody with IP  %s) have requested support for forgotten usernames for the email address \'%s\'.\\n\\nPlease check the following and act as suggested::\\n\\n-You have requested this mail by accident:\\nDelete this email.\\n\\n-You are sure, that you never requested this email:\\nPlease contact %s.\\n\\n- If you requested this email, please proceed as follows::\\n\\n1. Start your internet browser.\\n\\n2. Enter the following url:\\n\\t%s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your email program has inserted these line breaks.\\n\\n3. Your Browser now shows the Password-Service. Use this page together with one of the usernames and the according email address to retrieve a new password. \";}'),('rbac','en','a:22:{s:22:\"edit_learning_progress\";s:22:\"Edit learning progress\";s:16:\"filter_all_roles\";s:33:\"Show all roles of current context\";s:19:\"filter_global_roles\";s:22:\"Show only global roles\";s:18:\"filter_local_roles\";s:40:\"Show only local roles of current context\";s:25:\"filter_local_roles_object\";s:46:\"Show only local roles defined at this position\";s:25:\"filter_roles_local_policy\";s:53:\"Show only roles using a local policy at this position\";s:22:\"info_user_view_changed\";s:17:\"User view changed\";s:5:\"leave\";s:5:\"Leave\";s:20:\"msg_no_roles_of_type\";s:47:\"No Roles available with selected filter setting\";s:17:\"perm_administrate\";s:12:\"Administrate\";s:17:\"perm_class_create\";s:18:\"Create new objects\";s:22:\"perm_class_create_desc\";s:69:\"Determine which object types may be created under the current object.\";s:18:\"perm_class_general\";s:18:\"General operations\";s:23:\"perm_class_general_desc\";s:107:\"Common operations available for all objects. Hover the mousepointer over operation to get more information.\";s:17:\"perm_class_object\"